                                                                                                                                                                                                                                                                                    self.cp_hash_a = buffer.read_u8()?;
                                                                                                                                                                                                                                                                                    self.policy_ref = buffer.read_u8()?;
                                                                                                                                                                                                                                                                                    self.expiration = buffer.read_u32()?;
                                                                                                                                                                                                                                                                                    self.auth_sig_alg = TPM_ALG_ID::try_from(buffer.read_u32()?)?;
                                                                                                                                                                                                                                                                                    let selector = self.auth_sig_alg();
